import React from "react";

interface Props {
  uuid: string;
  type: "question" | "answer";
}

const OPActions: React.FC<Props> = ({ uuid, type }) => {
  return (
    <React.Fragment>
      <div className="actions-container">{uuid + type}</div>

      <style jsx>{`
        .actions-container {
          width: 95%;
          margin: 0 auto;
          border: 1px solid red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default OPActions;
